(1021, 5568, 'Gauhati University Examination Irregularities', 'From time to time, students of Gauhati University have suffered harassment due to the irregularities committed by Gauhati University in examinations/ results. The objective of this group is to provide a common ground to these students so that a united fight can be put up. Please do not hesitate, come forward and join this group. Examples of the irregularities committed by the GAuhato University are: (1) Issue of a final marksheet with "Absent" in one of the papers (hence witheld result), whereas the student was present for the paper. The problem has not been resolved after 1 year. (2) Issue of a blank marksheet to one student. The student was made to appear for compartmental exam unnecessarily. There are several such examples where students have suffered for several years.   ', 15, 1, 1, 0, 0, 0, '2015-10-06 08:07:00', '2015-10-06 08:07:00', 1, 0),
