(5058, 5123, 'mudmesh studios', 'http://mudmeshstudios.com', 'https://twitter.com/MudmeshStudios', 'https://www.facebook.com/MudmeshStudios', 'Mudmesh Studios is a complete creative design company with variousdepartments working on different genres of graphic design and the visual arts.\r\n\r\nThe name mudmesh is a symbol of our vast experience in the field and the variety of work that we do. Mud is the symbol of nature while mesh is the digital representation of a network or jumble of ideas. mudmesh is a collaboration of both. We take inspiration from our muse/nature and incorporate the ideas to the digital media, resulting in a union of raw talent, creativity and skill.', '\r\n\r\nMudmesh studios is a modern day''s design house, fully equipped with years of experience and several concepts for every new task. It''s a connection/bridge between our core nature and the modernism or technology. Transforming our muse into the digital ways/forms. With the increasing demand of brand establishment and recognition, it is connecting both brands and the people through the modern/digital ways with proactive approach. Which never can be compromised?', 1, 1, 0, 0, 6411, 0, '2015-09-04 10:32:50', '2015-09-04 10:32:50', 40, 52),
