(5063, 5132, 'Ittehad textiles', 'www.ittehadtextiles.com', '', 'https://www.facebook.com/houseofittehad', '', 'With almost four decades of distinction in the textile sector, Ittehad Group of Industries has come a long way. Launched in 1973, the early days saw Ittehad Textiles equipped with roller printing technology. Today, Ittehad Group of Industries has an extensive manufacturing network, with its own spinning, weaving, printing and embroidery units. Ittehad Textiles, the group''s processing and printing division, owns two flat-bed and two rotary printing machines. It is this complete control over every aspect of manufacturing that gives our products an edge and enhances quality.', 1, 1, 0, 0, 6514, 0, '2015-09-04 19:48:22', '2015-09-04 19:48:22', 22, 32),
(5064, 5133, 'House of Zunn', 'http://www.zunndesigns.com/fashion/', '', 'https://www.facebook.com/ZunnFashion', '', 'House of Zunn was established in 1987 to provide high quality apparel to its discerning clientele, a project which now includes a nationwide popular Lawn brand, luxury prt line and a high end Bridal couture line. Uzma Mirza and Seema Sherazee are natural-born designers enriching the everyday life with their passion for timeless design and sophistication. They are perfectionists - always delivering a memorable experience accompanying their creations, never just a product. Together they have created one of Pakistans most significant fashion portals, paving the way for the rest of the industry to follow.\r\n\r\nZunn strives to keep style versatility as its core focus while building a unique customer experience ', 1, 1, 0, 0, 6466, 0, '2015-09-04 19:52:37', '2015-09-04 19:52:37', 29, 37),
(5065, 5134, 'Sobia Nazir', 'http://www.sobianazir.net/', '', 'https://www.facebook.com/StudioSN', '', 'Sobia Nazir is not a new name in the fashion\r\nindustry of the country. In fact she is already\r\non top of her game transforming the blank\r\ncanvases of the fabrics into wonderful\r\nworks of art. Her designs have graced many\r\nrunway projects, magazines and fashion shows\r\naround the globe. Her aim is to transform the\r\ninspirations and expressions of the women into\r\na reality that they can flaunt with confidence,\r\nwhich is reflected in her clothing line. Sobias\r\nbroad spectrum vision includes styles that are\r\ncontemporary yet classic and ever evolving.', 1, 1, 0, 0, 6488, 0, '2015-09-04 20:03:15', '2015-09-04 20:03:15', 49, 27),
