(5072, 5175, 'Klik2learn', 'www.klik2learn.com', 'https://twitter.com/klik2learn', 'https://www.facebook.com/Klik2learn', 'Our mission is to inspire learners to take control of their own learning by producing quality e learning products that keep users enthralled throughout. We combine creativity, game- based learning  and digital design with a deep understanding of how people learn.   ', 'Klik2learn is an innovative e learning company specialising in English language learning. We have developed the first  fully online, level B1 English qualification endorsed by the Scottish Qualifications Authority. Our animators, games developers and programmers make serious learning fun whether you''re looking for a formal qualification or whether you just want to improve your English. If you want to concentrate on your spoken skills, watch out for our clever, new iphone app - Protalk. ', 15, 1, 0, 0, 6834, 0, '2015-09-08 09:37:19', '2015-09-14 22:01:57', 37, 22),
