(5077, 5220, 'WDM', 'www.wdmca.co.uk', '@wdmaccountants', '', 'WDM Chartered Accountants  More Than Just Numbers\r\nWe Grow Our Business By Helping You Grow Yours.\r\nIt really doesn''t matter whether youre a newbie, have an established business or you''ve been round the block. We have the team, desire, commitment and experience to know whats required to create that crucial win-win situation, by assisting you in all your accountancy and taxation needs. Further to that we provide business start-up and development services. \r\n', 'Providing accountancy and tax services to all types of businesses.\r\nWDM strives to give your business the competitive advantage it needs and demands.', 1, 1, 0, 0, 6908, 0, '2015-09-09 14:13:17', '2015-09-09 14:13:17', 41, 22),
(5078, 5237, '3.14 Clothing', 'www.3point14.co', 'twitter.com/314Clothing', 'https://www.facebook.com/3.14Clothing', '3.14 Team is recruited from different walks of life. Our team consists of anthropologists, psychologists, economists and scientists. 3.14 team of young entrepreneurs and artists bring fresh new ideas to cater the needs of our customers. Since our customers are no ordinary people, therefore we place their preferences among our extraordinary minds. The aim of 3.14 is to stimulate creativity, ideas, and innovation through increasing interactions and using multiple approaches.\r\n\r\nZafar Textiles, established in 1981, is the parent company of 3.14 Clothing. The inception of 3.14 Clothing took place in 2012 with an aim to build an economical clothing brand that revolves around creativity and innovation to provide the highest quality products to our customers.', '3.14 Clothing is the ultimate haven for casual clothing, driven by the engine of integrated creativity. At 3.14, our team finds inspiration in different spheres of life to create the best products available in Pakistan. Through extreme scrutiny and an elaborated process of constructive criticism, we pioneer our ideas to create trendy casual clothing of the highest quality and caliber. We aim to satisfy our consumers with the best of the products at the most affordable prices.\r\n\r\nOur products range from T-shirts to Hoodies to Polo shirts to Varsity Jackets to caps and much more!!', 1, 1, 0, 0, 0, 0, '2015-09-12 20:17:09', '2015-09-12 20:17:09', 2, 26),
