(5110, 5673, 'GFP', 'www.genfoam.com', '', 'www.facebook.com/gfpseasonaldecor', 'GFP (General Foam Plastics) is a supplier of holiday and seasonal home dcor and recreational family products. We make holidays and outdoors fun for the whole family with light up yard dcor for Christmas, Halloween, and Easter. In addition, we make summer even sweeter with Splash Time branded products such as pools, sand boxes and accessories.', 'GFP is a USA-based supplier of holiday/seasonal home dcor and recreational family products. We bring warmth and delight to families nationwide through our innovative and festive products. As seasons come and go, memories, laughter, and holiday nostalgia never fade with the help of GFPs products.', 1, 1, 0, 0, 0, 0, '2015-10-14 13:48:11', '2015-10-14 13:48:11', 0, 0),
