(38, 30, 0, 'Nescafe is the largest brand for Swiss food giant Nestle. The instant coffee brand derives its name from &quot;Nestle&quot; and &quot;cafe.&quot; The coffee originated in Brazil in the 1930s as an using Nestle''s expertise in milk processing to develop the instant coffee. Its popularity spread with the U.S. military during World War II. Nescafe launched its Gold Blend Barista Style in 2013, which is intended to appeal to customers who want a coffee-shop experience at home.', NULL),
