(40, 28, 0, 'The pioneers of the automobile industry at the end of the 19th century were Gottlieb Daimler and Carl Benz with Benz patenting what is widely viewed as the first automobile. Mercedes-Benz is a subsidiary of German-based Daimler and the brand is used on luxury cars, buses and trucks. Mercedes focuses its sponsorship spending on events that attract a well-heeled crowd. Its three pillars are golf, tennis and New Yorks Fashion Week. Mercedes won its first Constructors'' Championship as the top team in F1 in 2014 thanks to the dominant performances of drivers Lewis Hamilton and Nico Rosberg. The Mercedes-Benz brand sold a record 183,467 vehicles in March 2015, up 15.7% over the prior year.', NULL),
