(5132, 30, 0, 'With almost four decades of distinction in the textile sector, Ittehad Group of Industries has come a long way. Launched in 1973, the early days saw Ittehad Textiles equipped with roller printing technology. Today, Ittehad Group of Industries has an extensive manufacturing network, with its own spinning, weaving, printing and embroidery units. Ittehad Textiles, the group''s processing and printing division, owns two flat-bed and two rotary printing machines. It is this complete control over every aspect of manufacturing that gives our products an edge and enhances quality.', NULL),
