(5133, 29, 0, 'House of Zunn', NULL),
(5133, 30, 0, 'House of Zunn was established in 1987 to provide high quality apparel to its discerning clientele, a project which now includes a nationwide popular Lawn brand, luxury prt line and a high end Bridal couture line. Uzma Mirza and Seema Sherazee are natural-born designers enriching the everyday life with their passion for timeless design and sophistication. They are perfectionists - always delivering a memorable experience accompanying their creations, never just a product. Together they have created one of Pakistans most significant fashion portals, paving the way for the rest of the industry to follow.\r\n\r\nZunn strives to keep style versatility as its core focus while building a unique customer experience ', NULL),
