(5237, 28, 0, '3.14 Team is recruited from different walks of life. Our team consists of anthropologists, psychologists, economists and scientists. 3.14 team of young entrepreneurs and artists bring fresh new ideas to cater the needs of our customers. Since our customers are no ordinary people, therefore we place their preferences among our extraordinary minds. The aim of 3.14 is to stimulate creativity, ideas, and innovation through increasing interactions and using multiple approaches.\r\n\r\nZafar Textiles, established in 1981, is the parent company of 3.14 Clothing. The inception of 3.14 Clothing took place in 2012 with an aim to build an economical clothing brand that revolves around creativity and innovation to provide the highest quality products to our customers.', NULL),
(5237, 29, 0, '3.14 Clothing', NULL),
(5237, 30, 0, '3.14 Clothing is the ultimate haven for casual clothing, driven by the engine of integrated creativity. At 3.14, our team finds inspiration in different spheres of life to create the best products available in Pakistan. Through extreme scrutiny and an elaborated process of constructive criticism, we pioneer our ideas to create trendy casual clothing of the highest quality and caliber. We aim to satisfy our consumers with the best of the products at the most affordable prices.\r\n\r\nOur products range from T-shirts to Hoodies to Polo shirts to Varsity Jackets to caps and much more!!', NULL),
