(5466, 13, 0, 'Feel Nutritious exists to improve the health and wellbeing of our clients, through diet and education. We are committed to delivering high quality, actionable insight and advice both in the community and online.\r\n\r\nWe offer a range of services to clients of all ages, sexes and walks of life. Our programs are always bespoke. A cross-section of client demographics includes:\r\n\r\n Males and Females\r\n Individuals of all ages\r\n Overweight persons\r\n Parents (postnatal, anti-natal, childhood complaints)\r\n Individuals presenting with existing health issues\r\n Persons interested in improved health and wellbeing through clean eating and detox\r\n\r\nWe offer a bespoke consultancy service in one-to-one, family or group formats. Our focus is always on enabling our clients to achieve their specific desired outcomes.\r\n\r\nIn addition to client services, we develop and produce high quality informational content for distribution online and in the community. Across all facets of the business we aim to inform, educate and enable individuals to build themselves a healthier lifestyle.', NULL),
