(393, 'The Creative Village focuses specifically on creating quality media content through a state of the art production facility along with highly motivated and skilled team of media practitioners.', 'creativevillage', 'The Creative Village focuses specifically on creating quality media content through a state of the art production facility along with highly motivated and skilled team of media practitioners.', '', '2016-01-05 09:11:29', '2016-01-05 09:11:29'),
(394, '', 'AhmadNabiMcmullan', 'accounts', '', '2016-01-05 09:11:29', '2016-01-05 09:11:29'),
(395, 'Mudmesh Studios is a complete creative design company with variousdepartments working on different genres of graphic design and the visual arts.\r\n\r\nThe name mudmesh is a symbol of our vast experience in the field and the variety of work that we do. Mud is the symbol of nature while mesh is the digital representation of a network or jumble of ideas. mudmesh is a collaboration of both. We take inspiration from our muse/nature and incorporate the ideas to the digital media, resulting in a union of raw talent, creativity and skill.', 'mudmesh', '\r\n\r\nMudmesh studios is a modern day''s design house, fully equipped with years of experience and several concepts for every new task. It''s a connection/bridge between our core nature and the modernism or technology. Transforming our muse into the digital ways/forms. With the increasing demand of brand establishment and recognition, it is connecting both brands and the people through the modern/digital ways with proactive approach. Which never can be compromised?', '', '2016-01-05 09:11:29', '2016-01-05 09:11:29'),
(396, 'A brand-consumer engagement platform.', 'Kinnect2', 'A brand-consumer engagement platform.', '1', '2016-01-05 09:11:29', '2016-03-25 08:44:44'),
(397, '', 'imperialtex', 'Pakistan''s largest manufacturing, distribution and textile-solutions company for Designer textiles.', '', '2016-01-05 09:11:29', '2016-01-05 09:11:29'),
(398, '', 'MariaB', 'ARIA.B DESIGNS (PVT) LTD is the largest manufacturer and retailer of womens fashion garments in Pakistan, with a large clientele in the US and Europe.', '', '2016-01-05 09:11:29', '2016-01-05 09:11:29'),
(399, '', 'ittehad', 'With almost four decades of distinction in the textile sector, Ittehad Group of Industries has come a long way. Launched in 1973, the early days saw Ittehad Textiles equipped with roller printing technology. Today, Ittehad Group of Industries has an extensive manufacturing network, with its own spinning, weaving, printing and embroidery units. Ittehad Textiles, the group''s processing and printing division, owns two flat-bed and two rotary printing machines. It is this complete control over every aspect of manufacturing that gives our products an edge and enhances quality.', '1', '2016-01-05 09:11:29', '2016-03-18 09:51:41'),
(400, '', 'ZunnDesigns', 'House of Zunn was established in 1987 to provide high quality apparel to its discerning clientele, a project which now includes a nationwide popular Lawn brand, luxury prt line and a high end Bridal couture line. Uzma Mirza and Seema Sherazee are natural-born designers enriching the everyday life with their passion for timeless design and sophistication. They are perfectionists - always delivering a memorable experience accompanying their creations, never just a product. Together they have created one of Pakistans most significant fashion portals, paving the way for the rest of the industry to follow.\r\n\r\nZunn strives to keep style versatility as its core focus while building a unique customer experience ', '', '2016-01-05 09:11:30', '2016-01-05 09:11:30'),
(401, '', 'SobiaNazir', 'Sobia Nazir is not a new name in the fashion\r\nindustry of the country. In fact she is already\r\non top of her game transforming the blank\r\ncanvases of the fabrics into wonderful\r\nworks of art. Her designs have graced many\r\nrunway projects, magazines and fashion shows\r\naround the globe. Her aim is to transform the\r\ninspirations and expressions of the women into\r\na reality that they can flaunt with confidence,\r\nwhich is reflected in her clothing line. Sobias\r\nbroad spectrum vision includes styles that are\r\ncontemporary yet classic and ever evolving.', '', '2016-01-05 09:11:30', '2016-01-05 09:11:30'),
(402, 'Make the world''s lightest power to weight transmission systems. ', 'Fftech', 'Transport and leisure brand ', '', '2016-01-05 09:11:30', '2016-01-05 09:11:30'),
