(408, 'Our mission is to inspire learners to take control of their own learning and produce quality eLearning products that keep users enthralled throughout. With fun, innovative games and puzzles that can make a real impact on your English. ', 'Klik2learn', 'Klik2learn is a digital design company that specialises in education with the main beneficial goal being the acquisition of a British citizenship for work, school or just simply for fun. \r\nOur course offers the only fully online, fully digital level B1 English qualification. ', '', '2016-01-05 09:11:31', '2016-01-05 09:11:31'),
