(950, '1', '1980-01-01', 'Khurram Irshad is a sales and marketing guru with 15 years of global experience in Telecom, IT, Retail, Supply chain Management and Renewable Energy. He is educated in London and holds a B.Sc. and an M.B.A and holds a certification for the train the trainer program.\r\n\r\nHis career started as a Sales Manager at Dixon Carphone, 2000 in London and was promoted to General Manager of the flagship store on Oxford Street serving 2 million customers year.\r\n\r\nIn 2006 at the start of the smartphone revolution, Khurram was the key member to develop a new sales training program termed ''S.T.A.R.T.'' which took the customer on a journey to explore all the different smartphones available in market and helped choose the right one for each customer. He delivered sales training to 300+ customer consultants in 50 stores. With a 96% positive feedback, it became the best launch Sales program in the companys history.\r\n\r\nAfter moving back to Pakistan he jointed Systems Limited in 2010, the largest software house in Pakistan as Head of Sales and Marketing. Under his leadership the business grew 200% year on year.In 2012, Khurram joined Raaziq International (Largest National SCM Company) as a Project Manager for their flagship project of Huawei''s mega roll out for Mobilink/ Ufone 3G. He had a direct reporting of 100+ resources and successfully delivered the project in time and under budget.\r\n\r\nIn 2013, Khurram spearheaded the launch of a new company The Archive, providing 360 records management solution. He signed up one of the largest bank in Pakistan and established operations and sales team in Karachi.  Currently he is the Head of Sales and Distribution of Green Industree', 'Khurram Irshad is a sales and marketing guru with 15 years of global experience in Telecom, IT, Retail, Supply chain Management and Renewable Energy. He is educated in London and holds a B.Sc. and an M.B.A and holds a certification for the train the trainer program.\r\n\r\nHis career started as a Sales Manager at Dixon Carphone, 2000 in London and was promoted to General Manager of the flagship store on Oxford Street serving 2 million customers year.\r\n\r\nIn 2006 at the start of the smartphone revolution, Khurram was the key member to develop a new sales training program termed ''S.T.A.R.T.'' which took the customer on a journey to explore all the different smartphones available in market and helped choose the right one for each customer. He delivered sales training to 300+ customer consultants in 50 stores. With a 96% positive feedback, it became the best launch Sales program in the companys history.\r\n\r\nAfter moving back to Pakistan he jointed Systems Limited in 2010, the largest software house in Pakistan as Head of Sales and Marketing. Under his leadership the business grew 200% year on year.In 2012, Khurram joined Raaziq International (Largest National SCM Company) as a Project Manager for their flagship project of Huawei''s mega roll out for Mobilink/ Ufone 3G. He had a direct reporting of 100+ resources and successfully delivered the project in time and under budget.\r\n\r\nIn 2013, Khurram spearheaded the launch of a new company The Archive, providing 360 records management solution. He signed up one of the largest bank in Pakistan and established operations and sales team in Karachi.  Currently he is the Head of Sales and Distribution of Green Industree', '2016-01-05 09:10:13', '2016-01-05 09:10:13'),
