(40, 'Powerful Iceland', 'I''ve been shooting this video around iceland the last few months, it''s such an amazing country that everyone should witness with their own eyes.<br /> <br /> Locations:<br /> <br /> Mount Kirkjufell<br /> Vk  Mrdal<br /> Slheimasandur (DC-3 Plane)<br /> Sandvk<br /> Straumsvk<br /> Seljalandsfoss waterfall<br /> Goafoss waterfall<br /> Aldeyjafoss waterfall<br /> Hlmbergsviti lighthouse<br /> Garskagi lighthouse<br /> Hvalsneskirkja church<br /> Minesheii <br /> Vatnsnes<br /> <br /> Equipment used:<br /> <br /> Dji Phantom 3 Professional<br /> Canon EOS 6D<br /> Sony a7s<br /> Gopro Hero 4 Black<br /> <br /> Edited in Final Cut Pro X<br /> <br /> Music by: Matt Corby - Brother<br /> <br /> www.gardarolafs.com', 1, '', 31, NULL, NULL, '2015-07-24 06:48:03', '2015-07-24 06:48:08', 0, 0, 2, '134008155', 4110, 0, 0, 1, 0, 295, 0),
(41, 'Nike Pool', 'Back in May, Nuno and I headed out to England to shoot photos and film the Nike Pool jam. I had no idea what to expect when I was heading there, but the Nike Pool jam ended up being one of the best contest I have ever been to... not only from a riding standpoint, but also the vibe was amazing, everyone was having so much fun, the ramps were amazing, the free food, free beer... I could go on... Aside from the whole weekend being so much fun, the building and the ramps were amazing for filming. Great colors, interesting architecture, the two floors with windows looking down at the ramps. I was a kid in a candy store. This edit is more of a reflection of the weekend. A montage of a bunch of random stuff. I missed some bangers, filmed lots of random stuff and had a really fun time putting it all together... Enjoy!', 1, '', 2, NULL, NULL, '2015-07-24 10:56:32', '2015-07-24 10:57:17', 0, 0, 3, 'mp4', 4114, 0, 14, 1, 4113, 0, 0),
(42, 'Upgrading Your MacBook Pro with 2 Solid State Drives', 'Stop wasting space in your MacBook Pro with your optical drive and use a data doubler from OWC, macsales.com. Boost the performance of your computer with a new hard drive and RAM instead of buying a new machine.', 1, '', 3, NULL, NULL, '2015-07-24 11:15:52', '2015-07-24 11:16:03', 0, 0, 2, '75528677', 4115, 0, 0, 1, 0, 945, 0),
(45, 'Microsoft Story', 'How would you rebrand a familiar and world famous company?<br />  This time, Bito create a new character-Mr.Li and the smart helper- cloud boy for Microsoft, to lead the audience to get to know the new service from Microsoft.<br />  With new characters, the story indicate the general problems that most of the local business in Taiwan would face while upgrading their company to the next phase, and Microsoft just have the perfect way to solve their problem.<br />  <br />  Client Summer Advertising<br />  Directed by Bito<br />  Creative Director Keng-Ming Liu<br />  Producer Elise Gong<br />  Designer ChiGer Chen<br />  Storyboard ChiGer Chen Chu-Chieh Lee<br />  Animation ChiGer Chen<br />  Music & Sound Design Sincerely Music', 1, '', 6, NULL, NULL, '2015-07-24 12:04:05', '2015-07-24 12:04:15', 0, 0, 2, '117234773', 4125, 0, 0, 1, 0, 88, 0),
(46, 'HONDA NSX (EXTENDED VERSION) BY FORMAT67.NET', 'SUPPORT US! http://store.format67.net<br>  <br>  NOTE: TRY TO TAKE YOUR TIME TO WATCH THIS VIDEO. GET THE BEST VOLUME AND LEAN BACK.<br>  <br>  STORY:<br>  <br>  THE VIDEO SHOWS 7 DIFFERENT LIFES AT THE SAME TIME.<br>  AMONG THEM A HONDA NSX DRIVING FROM FRANKFURT TO THE LEGENDARY GREEN HELL "NUERBURGRING". <br>  EVERY INDIVIDUAL GET''S IN TOUCH WITH THE NSX. EACH WITH THEIR OWN PERCEPTION.', 1, '', 8, NULL, 6, '2015-07-24 12:27:44', '2015-07-24 12:28:49', 0, 0, 2, '13412780', 4129, 0, 0, 1, 0, 376, 0),
(47, 'Fashion Show with Google', 'At Wieden+Kennedy Tokyo we created a 30 second TV commercial for the launch of the new brand campaign Google and more in Japan. It features the Image Search functions sort by color and similar images and shows that you can do more with Google than you imagined. <br /> Directed by Kosai Sekine.<br /> <br /> More of our work on www.robbinwaldemar.com<br /> <br /> More Google experiments on www.demoslam.com', 1, '', 9, NULL, 7, '2015-07-24 12:52:10', '2015-07-24 12:52:56', 0, 0, 2, '17203320', 4134, 0, 0, 1, 0, 30, 0),
(48, 'Google - Introducing the Chromebook', 'To launch Google Chromebook, we came up with this video to be stream live at the Google I/O conference. The brilliant talents at Buck brought it to life. Not to mention Antfood''s incredible track. We''re all so pleased with the outcome.\r\nAnimation: Buck\r\nMusic: Antfood\r\nAgency: BBH New York\r\nCopywriter: Tara Lawall\r\nCopywriter: Jeff Johnson\r\nArt Director: Devon Hong\r\nExecutive Creative Director: Calle Sjoenell\r\nExecutive Creative Director: Pelle Sjoenell\r\nProducer: Larry Launter', 1, '', 9, NULL, NULL, '2015-07-24 13:06:50', '2015-07-24 13:06:52', 0, 0, 3, 'mp4', NULL, 0, 13, 3, 4135, 0, 0),
(49, 'Microsoft Brand "Estella"', '2015 Superbowl Commercial featuring the amazing Estella and her Brilliant Bus!', 0, '', 1, NULL, NULL, '2015-07-24 13:15:47', '2015-07-24 13:15:48', 0, 0, 2, '121060956', 4136, 0, 0, 1, 0, 60, 0),
