(52, 'Red Bull - That One Time: Surviving a Tsunami in Indonesia (2015)', 'Commissioned by Red Bull Media, this is the second of a series of four films which illustrate sport stories.<br />  Featuring 90s surfer Rob Bain<br />  <br />  Follow here: facebook.com/luizstockleranimation<br />  <br />  CREDITS:<br />  Commissioned by Red Bull Media<br />  Director: Luiz Stockler<br />  Animation: Luiz Stockler, Dana Giurescu <br />  Design: Luiz Stockler<br />  Interview: Red Bull Media<br />  Sound: Ana Roman<br />  Production Manager: Rebecca Little<br />  Produced by Agile Films <br />  <br />  More info on the story here: http://www.redbull.com/uk/en/surfing/stories/1331709652873/that-one-time-surviving-a-tsunami-in-indonesia<br />  <br />  Twitter: twitter.com/luizstockler<br />  Behance: behance.net/luizstockler', 1, '', 15, NULL, 13, '2015-07-24 14:00:07', '2015-07-24 14:00:13', 0, 0, 2, '121449045', 4141, 0, 0, 1, 0, 179, 0),
(53, 'Gatorade. Groove Like Mike', 'Executive Producer: Lautaro Brunatti / Leticia Christoph<br />  Creative Director: Tomi Dieguez<br />  <br />  Directors: Gato / Gianluca Fallone<br />  <br />  Line Producer: Lucio Fiorentini<br />  Art Director: Gianluca Fallone<br />  2D Animation Leads: Federico Radero / Pedro Blumenbaum<br />  Postproduction: Tronco<br />  <br />  https://www.behance.net/gallery/24596941/GATORADE', 1, '', 16, NULL, 14, '2015-07-24 14:08:42', '2015-07-24 14:09:00', 0, 0, 2, '122634600', 4144, 0, 0, 1, 0, 60, 0),
