(76, 'EMPORIO ARMANI 30th ANNIVERSARY', 'YEAR: 2011<br /> NERDO DESIGN COLLECTIVE:<br /> Alessandro Durando // Daniele Gavatorta // Lorenzo Levrero<br /> <br /> TYPE: Promo<br /> WHAT: 3D, Compositing, Designs and Animations<br /> PRODUCTION: Bonsaininja Studio<br /> CLIENT: Emporio Armani<br />  <br /> We have been called by Bonsaininja Studio to create a promo for the launch of the new eyewear product for the thirtieth Emporio Armani anniversary. We chose to use light to enhance the design, colors and materials of the product.<br /> This is the first time we work for a client in the fashion industry.', 1, '', 13, 'brand', 11, '2015-07-31 16:05:53', '2015-07-31 16:06:36', 1, 0, 2, '31022984', 4339, 0, 0, 1, 0, 55, 0),
