(78, 'RedBull Transforming Formula 1', 'I was hired by Aixsponza as texturing and shading artist.<br /> The project was done Vray for C4D 1.8. I was responsible for about 90% of the texturing and shading of the Cars, Drivers and Gear (Helmets & Clothing).<br /> <br /> I used my physical plausible shading work flow for all of the materials.<br /> <br /> It was great fun working with the Aixponza team for 2.5 months and a great project to work on.<br /> <br /> I hope you enjoy the result!<br /> <br /> <br /> Credits:<br /> -----------------------<br /> Client: Red Bull Media House<br /> Production Company & Agency: Peter Clausen Film & TV Produktions GmbH<br /> Director & Producer: Peter Clausen<br /> Line Producer: Cecilia Trck<br /> Voice-Over: Sebastian Vettel & Daniel Ricciardo VFX Director / Editing: Christian Tyroller<br /> VFX Supervisor / CD: Manuel Casasola Merkle<br /> Head of 3D Production: Matthias Zabiegly<br /> 3D Artists: Leonhard Akinbiyi, Elisabeth Schlichtner, Jens Kindler, Michael Haupt, Jrg Vogel, Sven Mai, Holger Aumller, Christian Freisleder, Lars Korb, Stefan Voigt, Holger Biebrach, Simon Fiedler, Patrick Hecht<br /> Junior 3D Artist: Thilo Seifert<br /> Animators: Philipp Strasser, Christian Scheck, Christian Lachenschmidt<br /> FX: Fuat Yksel<br /> Supervisor Car Asset: Holger Aumller<br /> Shading Artist: Raphael Rau<br /> CAD & Modeling: Christian Frg, Maruan Attia, Markus Sick<br /> Rigging: Jrg Vogel<br /> Tracking: Johannes Weiss<br /> Rotoscope: Manuel Voss<br /> Compositing: Alexander Gabrysch, Tobias Mller<br /> Producer Animation Studio: Julian Fischer Production Assistant: Jessica Lorenz<br /> DP: Philipp Geigel<br /> 1st Asst Camera: Hendrik Jansen<br /> 2nd Asst Camera: Stefan Betz<br /> Key Grip: Clemens Bachmann<br /> Grip Asst: Chrissi Heinrich<br /> Gaffer: Jrgen Thiele<br /> Electricians: Christian Weber, Christof v. Barany<br /> Special Constructions: Henrik Scheib<br /> Make-Up Artist: Sabine Gludovacz<br /> Stand-In Rehears