(284, 'Age of Ultron', 'When Tony Stark (Robert Downey Jr.) jump-starts a dormant peacekeeping program, things go terribly awry, forcing him, Thor (Chris Hemsworth), the Incredible Hulk (Mark Ruffalo) and the rest of the Avengers to reassemble. As the fate of Earth hangs in the balance, the team is put to the ultimate test as they battle Ultron, a technological terror hell-bent on human extinction. Along the way, they encounter two mysterious and powerful newcomers, Pietro and Wanda Maximoff.\r\n', 1, '', 5112, NULL, NULL, '2015-09-05 20:59:37', '2015-09-05 21:00:43', 0, 0, 3, 'mp4', 6570, 0, 5, 1, 6569, 0, 0),
