(286, 'REPTILE YOUTH ''MY YOKO ONO'' Music Video', 'What do you get when you blend 37 motion graphics students from Hyper Island with 2.5 days and an image of Willy Wonkas Oompa Loompa factory?<br />  <br />  My Yoko Ono music video entertains the concept that we are all operated by a higher order, becoming Puppets  of technology, entrusting the digital (FB) to archive our secrets. The film opens with a medical journal  design magazine hybrid, meant to simulate parents thumbing through a baby catalogue when gene selecting their perfect child.<br />  <br />  We switch between worlds, seeing the un-hazardous duo Mads and Esben being birthed to in an incubator, operated by Hyper Island students who rotate facial expressions and manipulate skin types.<br />  <br />  A collaboration with Lucy McRae and Hyper Island Motion Graphics 13 Stockholm.<br />  <br />  Directed by Lucy McRae in collaboration with Hyper Island Motion Graphics 13 Stockholm<br />  D.O.P: Felix Swensson <br />  Edited by Dorrit Andersen<br />  Post production by Norman Nisbet / Larsen VFX  <br />  Producer: Kate Constable, Leandro Santini, Andreas Markstrm, Daniel Cansu<br />  Starring: Reptile Youth<br />  Editing facilities by Welcome Post', 0, '', 1, NULL, NULL, '2015-09-07 13:07:26', '2015-09-07 13:07:26', 0, 0, 2, '55292988', 6673, 0, 0, 1, 0, 252, 0),
