(306, 'Klaus Rough Animation Reel', 'Some of the shots I did for the teaser ''Klaus''. I couldn''t have enjoyed more working on this project and being part of such a great team. Hope you like it!  Sergio Pablo''s original ''Klaus'' teaser: https://vimeo.com/126287950  More info: linkedin.com/profile/preview?locale=en_US&trk=prof-0-sb-preview-primary-button', 1, '', 5139, NULL, NULL, '2015-09-17 08:44:04', '2015-09-17 08:44:09', 0, 0, 2, '135202004', 7012, 0, 0, 1, 0, 51, 0),
(307, 'The Great Gatsby VFX', 'My name is Chris Godfrey and I was the VFX supervisor on the film. <br />  <br />  Baz has graciously agreed to let us release this ''before and afters'' reel to show our peer group the VFX work completed on his film ''The Great Gatsby''. While this specific reel was the work of Animal Logic (as my primary vendor), in total I worked with 7 vendors including Animal Logic, Rising Sun and Iloura in Australia, ILM in San Francisco and also Prime Focus and Method Vancouver.  We also ran an amazing internal SWAT team that completed over 400 shots. Congratulations to all who did such fabulous work on almost 1500 shots and especially to Andy Brown from Animal Logic who put this sequence together.<br />  <br />  Many thanks to Baz, CM, Catherine Knapman, Chris DeFaria and Mark Brown - and of course Prue Fletcher and Joyce Cox.', 1, '', 5139, NULL, NULL, '2015-09-17 08:52:08', '2015-09-17 08:52:13', 1, 0, 2, '68451324', 7013, 0, 0, 1, 0, 238, 0),
