(310, 'Yamaha - We R1', 'abstr^ct:groove is proud to introduce the new Yamaha R1 global film.<br />  Developed together with DLV BBDO''s creative team, the film was shot between Japan and Italy.<br />  This time we used many different cameras (Arri Alexa, Sony F55, Red Epic, Red Scarlet, Phantom, Blackmagic, GoPro and an iPhone.), type of lenses (Fujinon Alura, Zeiss Masterprime and Cooke S4) and techniques to capture the idea of symbiosis between superchampion Valentino Rossi and the fastest sport bike available on the market. <br />  We created many in-camera effects and we also had fun experimenting with body projection mapping.<br />  <br />  <br />  credits:<br />  <br />  client: Yamaha agency: DLV BBDO Milan<br />  executive creative directors: Stefania Siani, Federico Pepe<br />  client creative directors: Nicola Cellemme, Pasquale Frezza<br />  <br />  production company: abstr^ct:groove<br />  director: Luigi Pane<br />  executive producer: Giada Risso<br />  cinematographer: Diego Indraccolo<br />  producers: Claudia Amendola, Alessandro Salerno<br />  <br />  1st AD: Alice Gatti<br />  liquids effects: Simone Ciceri<br />  projection mapping engineering: Marco Landini, Ahmed Elmowafi (EOS, Milan) <br />  <br />  production Japan: Zero Hour<br />  <br />  ^:g animation team:<br />  Claudio Capellini<br />  Sergio Fornasieri<br />  Pierpaolo Mantuano<br />  Valentina Vicini<br />  <br />  editing: Luigi Pane<br />  colorist: Diego La Rosa<br />  <br />  music: Franky B and the Cryptic Monkeys<br />  (performed by Franky B, Giuseppe Cozzolino)<br />  mastering engineer: Bunt Stafford-Clark<br />  sound design: Daniele Fam, Michele Benedetti (Gigasound studio)', 1, '', 5661, 'brand', 5108, '2015-10-14 09:29:48', '2015-10-14 09:29:53', 1, 0, 2, '110927379', 7639, 0, 0, 1, 0, 73, 0),
(311, 'Yamaha - We R1', 'abstr^ct:groove is proud to introduce the new Yamaha R1 global film.<br />  Developed together with DLV BBDO''s creative team, the film was shot between Japan and Italy.<br />  This time we used many different cameras (Arri Alexa, Sony F55, Red Epic, Red Scarlet, Phantom, Blackmagic, GoPro and an iPhone.), type of lenses (Fujinon Alura, Zeiss Masterprime and Cooke S4) and techniques to capture the idea of symbiosis between superchampion Valentino Rossi and the fastest sport bike available on the market. <br />  We created many in-camera effects and we also had fun experimenting with body projection mapping.<br />  <br />  <br />  credits:<br />  <br />  client: Yamaha agency: DLV BBDO Milan<br />  executive creative directors: Stefania Siani, Federico Pepe<br />  client creative directors: Nicola Cellemme, Pasquale Frezza<br />  <br />  production company: abstr^ct:groove<br />  director: Luigi Pane<br />  executive producer: Giada Risso<br />  cinematographer: Diego Indraccolo<br />  producers: Claudia Amendola, Alessandro Salerno<br />  <br />  1st AD: Alice Gatti<br />  liquids effects: Simone Ciceri<br />  projection mapping engineering: Marco Landini, Ahmed Elmowafi (EOS, Milan) <br />  <br />  production Japan: Zero Hour<br />  <br />  ^:g animation team:<br />  Claudio Capellini<br />  Sergio Fornasieri<br />  Pierpaolo Mantuano<br />  Valentina Vicini<br />  <br />  editing: Luigi Pane<br />  colorist: Diego La Rosa<br />  <br />  music: Franky B and the Cryptic Monkeys<br />  (performed by Franky B, Giuseppe Cozzolino)<br />  mastering engineer: Bunt Stafford-Clark<br />  sound design: Daniele Fam, Michele Benedetti (Gigasound studio)', 1, '', 5661, 'brand', 5108, '2015-10-14 11:10:07', '2015-10-14 11:10:18', 0, 0, 2, '110927379', 7696, 0, 0, 1, 0, 73, 0),
(312, 'Things Laravel Made Me Believe - Jeffrey Way - Laracon EU 2015', 'This talk was given at Laracon EU 2015. Visit http://laracon.eu/2015 for more talks.\r\n\r\nLaravel''s extreme success and popularity can be reduced to a single word: simplicity. Surprisingly, however, writing simple code is no easy feat! This talk will discuss key decisions that led to Laravel''s success, while, in the process, reviewing a number of lessons-learned from over-architecting applications.', 1, '', 5116, 'group', 1024, '2015-11-02 04:14:24', '2015-11-02 04:14:47', 1, 0, 1, 'mDotS5BDqRM', 7842, 0, 0, 1, 0, 3240, 0),
