(314, 'SPECTRE - Final Trailer (Official)', 'This November, experience SPECTRE in IMAX theaters everywhere!  \r\n\r\nFollow Bond on http://www.Facebook.com/JamesBond007, on Twitter @007 and at the official website http://www.007.com\r\nSubscribe to Sony Pictures for more great content: http://bit.ly/SonyPicsSubscribe\r\n\r\nRelease Date: November 6, 2015\r\nA cryptic message from Bonds past sends him on a trail to uncover a sinister organisation. While M battles political forces to keep the secret service alive, Bond peels back the layers of deceit to reveal the terrible truth behind SPECTRE.\r\n\r\nStarring: Daniel Craig, Ralph Fiennes, Ben Whishaw, Naomie Harris, Rory Kinnear, Christoph Waltz, La Seydoux, Monica Bellucci, David Bautista and Andrew Scott.\r\nDirected By Sam Mendes\r\nWritten By John Logan, Neal Purvis & Robert Wade\r\nProduced By Michael G Wilson and Barbara Broccoli', 1, '', 5698, NULL, NULL, '2015-11-09 09:26:53', '2015-11-09 09:27:06', 0, 0, 1, 'z4UDNzXD3qA', 7895, 0, 0, 1, 0, 76, 0),
