(324, 'The Black Eyed Peas - Let''s Get Retarded (Live From Sydney To Vegas)', '"Let''s Get Retarded", appears on The Black Eyed Peas'' 2003 album Elephunk. It is the fourth single from the album.\r\n\r\n''Retarded'' is often a derogatory term used to describe those with developmental disabilities. This made the original version of the song unsuitable for play on most radio stations and at sports games. In 2004 the song''s lyrics were edited and the re-released single "Let''s Get It Started" found its way onto radio airwaves, movie soundtracks, and video games.', 1, '', 5116, NULL, NULL, '2016-01-04 11:17:32', '2016-01-04 11:17:42', 0, 0, 1, 'LiuH03U7WBU', 8297, 0, 0, 1, 0, 523, 0);
